import React from "react";
import { ImageList, ImageListItem, Stack, Tooltip } from "@mui/material";

function List({ items }) {
  return (
    <Stack spacing={0} direction="row" sx={{ overflowX: "auto" }}>
      <ImageList
        sx={{
          width: "80vw",
          display: "flex",
          flexDirection: "row",
        }}
        rowHeight={200}
      >
        {items.map((item) => (
          <Tooltip
            key={item.img}
            title={item.desc} // The title is the image description
            arrow
          >
            <ImageListItem
              sx={{
                flex: "0 0 auto",
                width: "20%",
                overflowY: "hidden",
                margin: "0",
                height: "200px",
                "&:hover": {
                  border: "1px solid indigo",
                },
              }}
            >
              <img
                src={`${item.img}?w=164&h=164&fit=crop&auto=format`}
                srcSet={`${item.img}?w=164&h=164&fit=crop&auto=format&dpr=2 2x`}
                alt={item.title}
                loading="lazy"
                style={{
                  objectFit: "cover",
                  width: "100%",
                  height: "100%",
                }}
              />
            </ImageListItem>
          </Tooltip>
        ))}
      </ImageList>
    </Stack>
  );
}

export default List;
